  [],\n\t\"revision_timestamp\": \"2015-05-06T21:39:33.234327\",\n\t\"name\": \"wiki-based-data-and-information-integration-wikidi2-system-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The proposed innovation is:rnrnA data and
  information integration (DI2) system built from the methods and tools used to create
  Wiki websites. Wiki (Hawaiian for \"quick\") is software that allows users to create
  and edit Web page content using any Web browser.rnrnThe significance of the innovation
  is that a Wiki-based DI2 system will:rnrn(1)  Produce a collaborative, interactive
  website designed for the unique needs of government and commercial  spacecraft projects
  for capturing, disseminating, managing and linking data resources across multiple
  projects and among distributed teams,rnrn(2)  Provide \"out of the box\" advanced
  DI2 capabilities needed by project management and technical personnel from day one,rnrn(3)
  \ Provide a low cost DI2 solution for small companies and teams needing alternatives
  to expensive, complicated and inflexible project management tools,rnrn(4)  Be easy
  to install, use and maintain without requiring programming or webmaster skills.rnrnThe
  proposed innovation merges the Wiki philosophy of fast, easy and rewarding online
  content creation with standard project management functions and capabilities for
  data and information integration within secure, user-authenticated environments.
  This facilitates critical elements of communication, interaction and data capture/synthesis
  that are often missing or underdeveloped in many traditional project management
  efforts. Phase 1 TRL will be 6.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
